Description:
Anita Blond and Anita Dark are without a doubt the two most beautiful Europeans girls who have ever graced our screens. Bisexual and insatiable, volcanic Anita Blond played very eclectic roles and displayed an impressive appetite for all thins sexual. Nicknamed &quot;The Black Panther of X&quot;, Anita Dark was irresistible too.
Taken from twelve various Marc Dorcel productions and directed by some of the best Europeans directors around, Very Best Of Anita Blond &amp; Anita Dark complies the hottest and most intense scenes our two sisters have acted in. A must see for every fan of Marc Dorcel's Euro touch!


